import React from 'react';

import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import LockIcon from './components/LockIcon';

function App() {
  return (
    <div className="App">
      <AppBar position="static">
        <Toolbar style={{ backgroundColor: "#8C661F" }}>
          <h2>노인을 위한 나라</h2>
        </Toolbar>
        <LockIcon/>
      </AppBar>

    </div>
  );
}

export default App;
